import React from 'react';
import './ContactUs.css';

const ContactUs = () => {
  return (
    <div className="contact-container">
      <h2>Contact Us</h2>

      <div className="contact-info">
        {/* Email Section */}
        <div className="contact-item email">
          <h3>Email Us</h3>
          <p>Have any queries? Feel free to drop us an email at:</p>
          <p><a href="mailto:rathoresachin2023@gmail.com">rathoresachin2023@gmail.com</a></p>
        </div>

        {/* WhatsApp Section */}
        <div className="contact-item whatsapp">
          <h3>WhatsApp Us</h3>
          <p>Contact us on WhatsApp for quick inquiries:</p>
          <p><a href="https://wa.me/c/995598283810">+995 598 28 38 10</a></p>
        </div>

        {/* Phone Section */}
        <div className="contact-item phone">
          <h3>Call Us</h3>
          <p>We are available for office visit from Monday to Sunday 9 AM - 6 PM:</p>
          <p><a href="tel:+995598283810">+995 598 28 38 10</a></p>
        </div>

        {/* Address Section */}
        <div className="contact-item address">
          <h3>Our Address</h3>
          <p>You can visit us at our Tbilisi office:</p>
          <p>Tbilisi, Georgia</p>
        </div>
      </div>

      {/* Office Hours Section */}
      <div className="contact-office-hours">
        <h2>For visit</h2>
        <h3>Offi</h3>
        <p>Monday to Sunday: 9 AM - 6 PM</p>
        <p>Call services available 24*7</p>
      </div>

      {/* Social Media Section */}
      <div className="contact-social">
        <h2>Connect With Us</h2>
        <p>Follow us on social media for the latest updates:</p>
        <div className="social-links">
          {/* <a href="https://www.facebook.com/adventuretalesworld" target="_blank" rel="noopener noreferrer">Facebook</a> */}
          <a href="https://www.instagram.com/p/C_arE4oN58E/?igsh=NW9tdWVsbjN1NnQx" target="_blank" rel="noopener noreferrer">Instagram</a>
          {/* <a href="https://twitter.com/adventuretales" target="_blank" rel="noopener noreferrer">Twitter</a> */}
        </div>
      </div>
    </div>
  );
};

export default ContactUs;
